import React from 'react';
import {ListGroup, Row, Col} from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
    .item: {
        width: 500px;
        padding: 100px;
    }
`;
export const Home = () => (
    <Styles>
        <Row className="justify-content-md-center" style={{maxWidth:"100%", width: "100%"}}>
            <Col>
                <ListGroup horizontal variant="flush">
                    <ListGroup.Item>PLĂȚI SECURIZATE</ListGroup.Item>
                    <ListGroup.Item>LIVRARE ÎN 3 ORE</ListGroup.Item>
                    <ListGroup.Item>100% DISCREȚIE ȘI GARANȚIE</ListGroup.Item>
                    <ListGroup.Item>FELICITARE CADOU</ListGroup.Item> 
                </ListGroup>
            </Col>
        </Row>
    </Styles>
)
